/**
 * Serializes data using a deterministic serialization
 * algorithm. This serialization method avoids possible
 * ambiguity due to JSON standard. Output for the
 * semantically same input is always going to be identical,
 * regardless of property order or formatting.
 *
 * This serialization algorithm is compatible with RFC8789.
 * Other implementations can use instructions provided by
 * this RFC to implement compatible solutions.
 * @see https://www.rfc-editor.org/rfc/rfc8785
 *
 * @param data {any} data to serialize
 * @returns {string} serialized data
 */
export declare function serializeData(data: any): string;
